import React, { useState } from 'react';
import Navbar from './navbar';
import Bhajanamindralu from '../components/bhajanmindralu';
import Users from '../components/users';
import Reports from '../components/reports';
import './landing.css';

const Landing = () => {
  const [activePage, setActivePage] = useState('');

  const renderPageContent = () => {
    if (activePage === '') {
      return <DefaultContent />;
    }
    switch (activePage) {
      case 'bhajanamindralu':
        return <Bhajanamindralu />;
      case 'users':
        return <Users />;
      case 'reports':
        return <Reports />;
      default:
        return null;
    }
  };

  return (
    <div>
      <Navbar setActivePage={setActivePage} />
      <div className="landing-container">
      <div className="page-content">
      {renderPageContent()}
      </div>
        <div className="image-container">
          <div className="imageoverlay">
            <img src="/path/to/image1.jpg" alt="Image 1" className="image" />
          </div>
        </div>

        <div className="image-container">
          <div className="imageoverlay">
            <img src="/path/to/image2.jpg" alt="Image 2" className="image" />
          </div>
        </div>
        </div>


    </div>
  );
};

const DefaultContent = () => {
  return (
    <div>
      <h1>Lorem, ipsum dolor sit amet consectetur adipisicing elit. Dolorum illo accusamus consectetur ut excepturi praesentium neque quo eos sequi. Enim voluptatem iure adipisci ipsa aut obcaecati quam suscipit quaerat quibusdam.</h1>
      <p>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Fugiat nostrum harum cupiditate nobis nisi adipisci quisquam aliquid explicabo deserunt, tenetur magnam architecto velit autem placeat voluptates? Quos maiores minima dolores!</p>
      <p>Lorem ipsum, dolor sit amet consectetur adipisicing elit. Nobis odit veritatis maxime iste atque tempore, animi, dolores tenetur ipsum maiores dolorum enim doloremque architecto ad. Blanditiis consequatur nemo esse dolor.</p>
    </div>
  );
};

export default Landing;
